import React, { useEffect, useState } from 'react';
import { SlideShow } from './SlideShow';
import axios from 'axios';
import { HomeItemList } from './HomeItemList';

export default function App() {
  const [banners, setBanners] = useState([]);
  useEffect(()=>{
    axios.get('https://photo.azurecloud.vn/api/v1/banners/list-banner-active')
    .then(data=>{
      console.log(data.data.data.banners.data);
      let b = data.data.data.banners.data;
      
      setBanners(b);
    })
  },[]);
  return (
    <div>
      <SlideShow banners={banners}></SlideShow>
      <HomeItemList title="Moi nhat" ></HomeItemList>
    </div>
   
  );
}
